export function InsertionSort(array) {
    const animations=[];
    console.log(array);
    for(let i=0;i<array.length;i++)
    {
        let key=array[i];
        let j= i-1;
        while(j>=0&& arr[j]>key)
        {
            arr[j+1]=arr[j];
            j--;
        }
        arr[j+1]=key;
    }
    console.log(array);
    return animations;
}
